import { useEffect, useState } from 'react';

function PersonalInfo() {
    const [userInfo, setUserInfo] = useState({
        name: 'Nguyễn Văn A',
        email: 'nguyenvana@example.com',
        phone: '0123456789',
    });

    const [userRole, setUserRole] = useState(null);

    // Lấy userRole từ localStorage
    useEffect(() => {
        const user = localStorage.getItem('user');
        if (user) {
            const parsedUser = JSON.parse(user);
            setUserRole(parsedUser.role); // Lưu trữ userRole
        }
    }, []);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setUserInfo((prevState) => ({
            ...prevState,
            [name]: value,
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Thực hiện cập nhật thông tin người dùng
        console.log('Cập nhật thông tin:', userInfo);
    };

    if (!userRole) return <div>Đang tải...</div>;

    return (
        <div className="personal-info">
            <h2>Thông tin cá nhân</h2>
            <form onSubmit={handleSubmit}>
                <div>
                    <label>Tên:</label>
                    <input
                        type="text"
                        name="name"
                        value={userInfo.name}
                        onChange={handleChange}
                    />
                </div>
                <div>
                    <label>Email:</label>
                    <input
                        type="email"
                        name="email"
                        value={userInfo.email}
                        onChange={handleChange}
                    />
                </div>
                <div>
                    <label>Số điện thoại:</label>
                    <input
                        type="text"
                        name="phone"
                        value={userInfo.phone}
                        onChange={handleChange}
                    />
                </div>

                {/* Admin (ad) */}
                {userRole === 'ad' && (
                    <div>
                        <h3>Thông tin quản trị viên</h3>
                        <button type="submit">Cập nhật thông tin quản trị viên</button>
                        <button type="button">Quản lý tài khoản người dùng</button>
                        <button type="button">Quản lý hệ thống</button>
                    </div>
                )}

                {/* Center Manager (cm) */}
                {userRole === 'cm' && (
                    <div>
                        <h3>Thông tin quản lý trung tâm</h3>
                        <button type="submit">Cập nhật thông tin quản lý</button>
                        <button type="button">Quản lý nhóm học sinh</button>
                        <button type="button">Tạo thời khóa biểu</button>
                        <button type="button">Xem báo cáo chấm công</button>
                    </div>
                )}

                {/* Teacher (gv) */}
                {userRole === 'gv' && (
                    <div>
                        <h3>Thông tin giáo viên</h3>
                        <button type="submit">Cập nhật thông tin giáo viên</button>
                        <button type="button">Chấm công</button>
                        <button type="button">Xem lương của tôi</button>
                        <button type="button">Nhập điểm học sinh</button>
                    </div>
                )}

                {/* Student (hv) */}
                {userRole === 'hv' && (
                    <div>
                        <h3>Thông tin học viên</h3>
                        <button type="submit">Cập nhật thông tin học viên</button>
                        <button type="button">Xem lịch học</button>
                        <button type="button">Xem điểm</button>
                        <button type="button">Xem lịch sử thanh toán</button>
                    </div>
                )}
            </form>
        </div>
    );
}

export default PersonalInfo;
